import React, { useState, useEffect } from "react";
import { NavLink, useLocation } from "react-router-dom";
import { FaUserCircle, FaSignOutAlt } from "react-icons/fa";
import "../styles/styles.css";

const Navigation = () => {
  const [isDropdownOpen, setDropdownOpen] = useState(false);
  const [userFirstName, setUserFirstName] = useState(null);
  const location = useLocation(); // To get the current path

  const [activeTab, setActiveTab] = useState("");

  useEffect(() => {
    const token = localStorage.getItem("access_token");
    if (token) {
      try {
        const decodedToken = JSON.parse(localStorage.getItem("user_data"));
        setUserFirstName(decodedToken ? decodedToken.fname : null);
      } catch (e) {
        console.error("Error decoding token", e);
      }
    }
  }, []);

  // Set the active tab based on the current location
  useEffect(() => {
    if (location.pathname === "/") {
      setActiveTab("home");
    } else if (location.pathname === "/trades") {
      setActiveTab("trades");
    } else if (location.pathname === "/analysis") {
      setActiveTab("analysis");
    } else if (location.pathname === "/accounts") {
      setActiveTab("accounts");
    } else if (location.pathname === "/settings") {
      setActiveTab("settings");
    } else if (location.pathname === "/start") {
      setActiveTab("login");
    }
  }, [location]);

  const toggleDropdown = () => setDropdownOpen(!isDropdownOpen);
  const closeDropdown = () => setDropdownOpen(false);

  return (
    <div className="navigation">
      {userFirstName ? (
        <div className="nav-container">
          <div className="search">
            <input type="text" placeholder="Search..." />
          </div>
          <div className="nav-links">
            <button
              className={`tab-button ${activeTab === "home" ? "active" : ""}`}
              onClick={() => setActiveTab("home")}
            >
              <NavLink exact to="/">
                Home
              </NavLink>
            </button>
            <button
              className={`tab-button ${activeTab === "trades" ? "active" : ""}`}
              onClick={() => setActiveTab("trades")}
            >
              <NavLink to="/trades">Trades</NavLink>
            </button>
            <button
              className={`tab-button ${
                activeTab === "analysis" ? "active" : ""
              }`}
              onClick={() => setActiveTab("analysis")}
            >
              <NavLink to="/analysis">Analysis</NavLink>
            </button>
            <div className="user-dropdown" onMouseLeave={closeDropdown}>
              <button className="user-btn" onClick={toggleDropdown}>
                <FaUserCircle className="user-icon" />
                <span>{userFirstName}</span>
              </button>
              {isDropdownOpen && (
                <div className="dropdown-menu">
                  <button
                    className={`tab-button ${
                      activeTab === "accounts" ? "active" : ""
                    }`}
                    onClick={() => setActiveTab("accounts")}
                  >
                    <NavLink to="/accounts">Profile</NavLink>
                  </button>
                  <button
                    className={`tab-button ${
                      activeTab === "settings" ? "active" : ""
                    }`}
                    onClick={() => setActiveTab("settings")}
                  >
                    <NavLink to="/settings">Settings</NavLink>
                  </button>
                  <button
                    className="logout-btn"
                    title="Logout"
                    onClick={() => {
                      localStorage.removeItem("access_token");
                      localStorage.removeItem("user_data");
                      window.location.href = "/start";
                    }}
                  >
                    <FaSignOutAlt className="logout-icon" />
                  </button>
                </div>
              )}
            </div>
          </div>
        </div>
      ) : (
        <div className="nav-links">
          <button
            className={`tab-button ${activeTab === "login" ? "active" : ""}`}
            onClick={() => setActiveTab("login")}
          >
            <NavLink to="/start">Login</NavLink>
          </button>
        </div>
      )}
    </div>
  );
};

export default Navigation;
